var RESIZED=true;var TOPS=[];$(function jQueryResize(){$(window).resize(function(){RESIZED=true;fixNavTab()});fixNavTab()});function fixNavTab(){$(".navtab").css("top",String($(".navbar-fixed-top")[0].offsetHeight-Math.max(0,(17-$(window).width()/150)))+"px")}function bolden(a){for(var b=1;b<7;b++){if(b<=a){$("#li-impact-"+b).addClass("selected")}else{$("#li-impact-"+b).removeClass("selected")}}}function scrollEvent(){if(RESIZED){TOPS=[];for(var b=1;b<7;b++){TOPS.push(($("#impact-"+b).offset()).top)}RESIZED=false}var a=$(window).scrollTop();for(b=1;b<7;b++){if(a<TOPS[b-1]){bolden(b);break}}}$(function jQueryScroll(){if($("#impact-1").length>0){$(window).scroll(function(){scrollEvent()})}});